import React, { useState } from "react";
import {
  Box,
  Button,
  FormControl,
  FormLabel,
  Input,
  Textarea,
  Select,
} from "@chakra-ui/react";
import { ChakraProvider } from "@chakra-ui/react";
import { useNavigate } from "react-router-dom";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import "./mix.css";

const RegisterUserdata = () => {
  const [userData, setUserData] = useState({
    firstName: '',
    lastName: '',
    designation: '',
    education: '',
    address: '',
    dob: '',
    nic: '',
    telephoneNumber: '',
    available: '',
    nationality: '',
    consultantType: '',
    availableTime: '',
    description: '',
    cv: null,
    photo: null,
  });

  const history = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUserData({ ...userData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch("/consultants", {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify(userData)
      });

      if (!response.ok) {
        throw new Error("Failed to create consultant details");
      }

      const data = await response.json();
      toast.success(data.message);
      history("/dashboard");
    } catch (error) {
      console.error(error);
      toast.error("Failed to create consultant details");
    }
  };

  return (
    <ChakraProvider>
      <div className="">
        <Box maxW="md" mx="auto" p="6">
          <div className="m-30 bg-gray-100 rounded-xl">
            <div className="form_heading">
              <h1 className="text-black font-bold text-3xl p-5">User Data Form</h1>
            </div>
            <Box p={4}>
              <form onSubmit={handleSubmit}>
                <FormControl id="firstName" isRequired>
                  <FormLabel>First Name</FormLabel>
                  <Input
                    type="text"
                    name="firstName"
                    value={userData.firstName}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="lastName" isRequired mt={4}>
                  <FormLabel>Last Name</FormLabel>
                  <Input
                    type="text"
                    name="lastName"
                    value={userData.lastName}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="designation" isRequired mt={4}>
                  <FormLabel>Designation</FormLabel>
                  <Input
                    type="text"
                    name="designation"
                    value={userData.designation}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="education" isRequired mt={4}>
                  <FormLabel>Education</FormLabel>
                  <Input
                    type="text"
                    name="education"
                    value={userData.education}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="address" isRequired mt={4}>
                  <FormLabel>Address</FormLabel>
                  <Input
                    type="text"
                    name="address"
                    value={userData.address}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="dob" isRequired mt={4}>
                  <FormLabel>Date of Birth</FormLabel>
                  <Input
                    type="date"
                    name="dob"
                    value={userData.dob}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="nic" isRequired mt={4}>
                  <FormLabel>NIC</FormLabel>
                  <Input
                    type="text"
                    name="nic"
                    value={userData.nic}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="telephoneNumber" isRequired mt={4}>
                  <FormLabel>Telephone Number</FormLabel>
                  <Input
                    type="text"
                    name="telephoneNumber"
                    value={userData.telephoneNumber}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="available" isRequired mt={4}>
                  <FormLabel>Available</FormLabel>
                  <Select
                    name="available"
                    value={userData.available}
                    onChange={handleChange}
                  >
                    <option value="Yes">Yes</option>
                    <option value="No">No</option>
                  </Select>
                </FormControl>
                <FormControl id="nationality" isRequired mt={4}>
                  <FormLabel>Nationality</FormLabel>
                  <Input
                    type="text"
                    name="nationality"
                    value={userData.nationality}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="consultantType" isRequired mt={4}>
                  <FormLabel>Consultant Type</FormLabel>
                  <Input
                    type="text"
                    name
                    ="consultantType"
                    value={userData.consultantType}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="availableTime" isRequired mt={4}>
                  <FormLabel>Available Time</FormLabel>
                  <Input
                    type="text"
                    name="availableTime"
                    value={userData.availableTime}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="description" isRequired mt={4}>
                  <FormLabel>Description</FormLabel>
                  <Textarea
                    name="description"
                    value={userData.description}
                    onChange={handleChange}
                  />
                </FormControl>
                <FormControl id="cv" isRequired mt={4}>
                  <FormLabel>CV</FormLabel>
                  <Input
                    type="file"
                    accept=".pdf,.doc,.docx"
                    name="cv"
                    onChange={(e) => setUserData({ ...userData, cv: e.target.files[0] })}
                  />
                </FormControl>
                <FormControl id="photo" isRequired mt={4}>
                  <FormLabel>Photo</FormLabel>
                  <Input
                    type="file"
                    accept=".jpg,.jpeg,.png"
                    name="photo"
                    onChange={(e) => setUserData({ ...userData, photo: e.target.files[0] })}
                  />
                </FormControl>
                <Button type="submit" style={{ backgroundColor: '#1a365d', width: "100%", color: "#fff" }} mt={4}>
                  Submit
                </Button>
              </form>
            </Box>
          </div>
        </Box>
      </div>
      <ToastContainer />
    </ChakraProvider>
  );
};

export default RegisterUserdata;
